import React from 'react';
import './style.css'
import { Card } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const Check = (props) => {
    const { data } = props;

    return(
        <div className="container checkPage">
            <h1>PLAGIARISM CHECKER</h1>
            <div className="row">
                <div className="col-sm-9">
                    <Card className="textWrapper">
                        <Card.Body className="scroll">
                            {data.map((data) => {
                                return( 
                                    <p>{data.data}</p>
                                )
                            })}
                        </Card.Body>
                    </Card>
                </div>
                <div className="buttonCheck">
                    <button className="btn btn-success">CHECK PLAGIARISME</button>
                    <br />
                    <Link to="/"><button className="btn btn-danger">CENCEL</button></Link>
                    <p>Note: This will only check into our database*</p>
                </div>
            </div>
        </div>
    )
}

export default Check;
